import React from "react";
import { Route, Routes, Navigate } from "react-router-dom";
import LoginComponent from '../login_component';
import SignupComponent from '../signup_component';
import UserDetails from '../users/userDetails';
import CompanyHome from '../company/companyHome';
import UpdateUser from '../users/updateUser';
import UpdateCompany from '../company/updateCompany';
import UserHome from '../users/userHome';
import SuperUserData from '../superUser/superUserHome';
import SuperUserLogin from '../superUser/superUserLogin';

export default function Router() {
  // Check if the user is authorized (e.g., based on a token)
  const isAuthorized = localStorage.getItem("superUserToken") === "yourToken"; // Replace with your token check

  return (
    <Routes>
      <Route path='/' element={<LoginComponent />} />
      <Route path='/login' element={<LoginComponent />} />
      <Route path='/register' element={<SignupComponent />} />
      <Route path='/userDetails' element={<UserDetails />} />
      <Route path='/companyHome' element={<CompanyHome />} />
      <Route path='/updateUser' element={<UpdateUser />} />
      <Route path='/updateCompany' element={<UpdateCompany />} />
      <Route path='/userHome' element={<UserHome />} />

      {/* Check for superuser authorization before rendering the SuperUserData component */}
      <Route
        path='/superuser'
        element={isAuthorized ? <SuperUserData /> : <Navigate to="/superUser/login" />}
      />

      <Route path='/superUser/login' element={<SuperUserLogin />} />
    </Routes>
  );
}
